import React from "react";
import './profile.css';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';


//Sign in/login
//Avatar
//Username
//settings -- dark mode
//Notification
// 

const useStyles = makeStyles(theme => ({
    list: {
        display: 'flex',
        flexDirection: 'column',
        margin: 'auto',
        width: '100%',
        maxWidth: '300px',
    },
    listItem: {
        height: 90,
    },
    listText: {
        margin: 'auto',
    }
}))

export default function Profile() {
    const classes = useStyles();
    const [loggedIn, setLoggedIn] = React.useState(true);

    function logged() {
        if (loggedIn !== true) {
            return <div className="profile-login-avatar">Sign In/Log In</div>
        } else {
            return <div className="profile-avatar"><Avatar>H</Avatar></div>
        }
    }

    return (
        <List className={classes.list}>
            {['Display', 'Privacy', 'Notifications'].map((text, index) => (
                <ListItem className={classes.listItem} onClick={event => handleListItemClick(event, text)}>
                    <ListItemText className={classes.listText} >Display</ListItemText>

                    <Divider />
                </ListItem>
            ))}
        </List>
    )
}
